B.Ch=A.b(s(["This description should never be shown","Ramen noodles are distinct from other doughs in that the amount of water added to them (described as the \u201chydration\u201d or \u201chydration percentage\u201d), is noticeably low. In most ramen applications, hydration spans anywhere from 22% to 42% the weight of the dry flour solids. By contrast, most bread doughs start at about 60% hydration.","Wheat flour is the primary source of starch and protein in all ramen noodles and is a requirement for ramen to exist. To start, keep it simple; bread flour works very well. I like to use King Arthur bread flour because the protein content is around 12.7% the weight of the flour, and the flour gives consistent results. As you get more comfortable, feel free to adjust flours.","Kansui is a catchall term for the alkaline salts used to increase the pH of the water and impact the gluten and structure of the noodle. Several different salts can be considered kansui. In American kitchens, the most common salts are sodium carbonate and potassium carbonate.","Salt performs a similar, but different, function to alkaline salts on the structure of the dough. Sodium ions from the salt help the gluten retain rigidity, prevent overhydration, and increase your ability to mix the dough without over-developing gluten. Sodium carbonate would also contribute to this by providing sodium, but it being alkaline salt it serves a different chemical function. Salt also adds flavor to the dough."]),t.s)
